class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }

    render() { 
        const movies = readFile("../data/movielist.json").then(res => res.json())

        return (  
            <div>
                <Link href='./movie-details'><a>Click</a></Link>
                {movies.forEach(element => {
                    console.log(element.id)
                })}
            </div>
        );
    }
}

export default App;
